import React from "react";

import "../styles/content.css"

type Object = {
    x: number;
    y: number;
    type: "chair" | "table" | "sitting";
};

type Info = {
    time: number
    now?: number
    data: Object
}

type Props = {
    objects?: Info;
};

const countObjects = (objects: Object[], targetType: Object['type']): number => {
    let count = 0;

    objects.forEach((objects) => {
        if (objects.type === targetType) {
            count++
        }
    })
    return (count)
}

const ShowAvailable = ({ objects }: Props) => {
    return (
        <div className="showinfo">
            <div className="showAvailable">
                <h2>1층 오픈 스튜디오의 사용률:</h2>
                {}
            </div>
            <div className="showChair">
                현재 총 의자의 개수는 {countObjects(objects?.data, "chair")} 입니다.
            </div>
            <div className="showTable">
                현재 총 테이블의 개수는 {countObjects(objects.data, "table")} 입니다.
            </div>
        </div>
    )
}

export default ShowAvailable
